import React, { Component } from "react";
import ReactDOM from "react-dom";
import ReactCardCarousel from "react-card-carousel";

class Play extends Component {
  static get CONTAINER_STYLE() {
    return {
      position: "relative",
      height: "100vh",
      width: "100%",
      display: "flex",
      flex: 1,
      justifyContent: "center",
      alignItems: "middle"
    };
  }

  static get CARD_STYLE() {
    return {
      height: "400px",
      width: "600px",
      textAlign: "center",
      color: "#000000",
      background: "#FFFF00",
      fontFamily: "avenir-black",
      fontSize: "40px",
      textTransform: "uppercase",
      borderRadius: "10px",
      border:"#000000",
      boxSizing: "border-box"
    };
  }

  render() {
    return (
      <div>
      <h1 className='title'> honestly. </h1>
      <div style={Play.CONTAINER_STYLE}>
        <ReactCardCarousel autoplay={false} autoplay_speed={2500}>
          <div style={Play.CARD_STYLE}>First Card</div>
          <div style={Play.CARD_STYLE}>Second Card</div>
          <div style={Play.CARD_STYLE}>Third Card</div>
          <div style={Play.CARD_STYLE}>Fourth Card</div>
          <div style={Play.CARD_STYLE}>Fifth Card</div>
        </ReactCardCarousel>
      </div>
      </div>
    );
  }
}

export default Play;
